def new_approach_cf(genome, k, l, t):
    kmerdict = {}
    kmerFinal=[]
    debugdict = {}
    for i in range(len(genome)-k):
        kmer = genome[i:i+k]
        if i <= l:
            try:
                kmerdict[kmer]+=1
                if kmerdict[kmer]>=t:
                    kmerFinal.append("".join(kmer))
            except KeyError:
                kmerdict[kmer]=1
            
        
        else:
            try:
                kmerdict[kmer]+=1
                if kmerdict[kmer]>=t:
                    kmerFinal.append("".join(kmer))
            except KeyError:
                kmerdict[kmer]=1
            kmerMinus = genome[i-l:i-l+k]
            kmerdict[kmerMinus]-=1
    return " ".join(list(set(kmerFinal)))


